export const CarViewRow = props => {

    const onClickDelete = () =>{
        props.deleteCar(props.car.id);
    }

    const onClickEdit = () =>{
        props.editCar(props.car.id);
    }

    return (
        <tr key={props.car.id}>
            <td>{props.car.id}</td>
            <td>{props.car.make}</td>
            <td>{props.car.model}</td>
            <td>{props.car.year}</td>
            <td>{props.car.color}</td>
            <td>{props.car.price}</td>
            <td>
                <button type="button" onClick={onClickDelete}>Edit</button>
                <button type="button" onClick={onClickDelete}>Delete</button>
            </td>
        </tr>
    )
};

CarViewRow.defaultProps = {
    car: {},
}
